let candle = record.current
let len = 9

variable.closeArray.push(candle.close)
if (variable.closeArray.length > len) { variable.closeArray.splice(0, 1) }


let mom = Math.abs(variable.closeArray[len - 1] - variable.closeArray[len - 2])
variable.momArray.push(mom)
if (variable.momArray.length > len) { variable.momArray.splice(0, 1) }

let momSMA = calculateSMA(variable.momArray, len)

let momLen = variable.closeArray[len - 1] - variable.closeArray[0]

variable.CMO = (momLen / (momSMA * len)) * 100

variable.CMO = variable.CMO || 0

function calculateSMA(values, periods) {
    if (values.length < periods) { return 0 }

    let sum = 0
    for (let i = values.length - periods; i < values.length; i++) {
        sum = sum + values[i]
    }
    let sma = sum / periods
    return sma
}

